/* Внимание, данный запрос удаляет текущую колонку с номерами телефонов и подставляет на её место колонку в 
которой хранятся отформатированные телефоны. Старая колонка будет висеть как phone_to_delete и в следующих 
версиях будет удалена */
ALTER TABLE `ok_orders`
CHANGE `phone` `phone_to_delete` varchar(32) COLLATE 'utf8mb4_unicode_ci' NOT NULL DEFAULT '' AFTER `address`,
CHANGE `formatted_phone` `phone` varchar(32) COLLATE 'utf8mb4_unicode_ci' NULL DEFAULT '' AFTER `address`;

ALTER TABLE `ok_orders` DROP INDEX `formatted_phone`;
ALTER TABLE `ok_orders` ADD INDEX `phone` (`phone`);



